import { Link } from "react-router-dom";


const Navbar = () => {
    return (
      <nav className="navbar">
        <div className="links">
          <Link to="/home" style={{
            color: 'black', 
            padding: '10px',
            backgroundColor: '#f8f9fa',
            borderRadius: '9px'
          }}>Home</Link>
          <Link to="/Registration" style={{ 
            color: 'black', 
            padding: '10px',
            backgroundColor: '#f8f9fa',
            borderRadius: '9px'
          }}>Registracija</Link>
          <Link to="/Login" style={{ 
            color: 'black', 
            padding: '10px',
            backgroundColor: '#f8f9fa',
            borderRadius: '9px' 
          }}>Log in</Link>
        </div>
      </nav>
    );
  }

  export default Navbar;
